import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import NavButtons from "../NavButtons/NavButtons.jsx";

const Education = (props) => {
  const useStyles = makeStyles((theme) => ({
    root: {
      "& > *": {
        marginTop: theme.spacing(2),
        width: "50ch",
      },
    },
  }));
  const classes = useStyles();
  const { step, setStep } = props;
  const [values, setValues] = React.useState({
    college: "",
    from: "",
    to: "",
    degree: "",
    cgpa: "",
  });
  const [errors, setErrors] = React.useState({
    college: false,
    from: false,
    to: false,
    degree: false,
    cgpa: false,
  });
  const [errorMessage, setErrorMessages] = React.useState({
    college: "",
    from: "",
    to: "",
    degree: "",
    cgpa: "",
  });
  const validateInfo = () => {};

  return (
    <div>
      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField
              label="College"
              variant="outlined"
              value={values.name}
              onChange={(event) => onValueChange("name", event)}
              error={errors.name}
              helperText={errors.name && errorMessages.name}
              required
            />
            <TextField
              label="Joining Year"
              variant="outlined"
              type="email"
              value={values.email}
              onChange={(event) => onValueChange("email", event)}
              error={errors.email}
              helperText={errors.email && errorMessages.email}
              required
            />
            <TextField
              label="Expected Year of Graduation"
              variant="outlined"
              value={values.pno}
              onChange={(event) => onValueChange("pno", event)}
              error={errors.pno}
              helperText={errors.pno && errorMessages.pno}
              required
            />
            <TextField
              label="Degree"
              variant="outlined"
              value={values.pno}
              onChange={(event) => onValueChange("pno", event)}
              error={errors.pno}
              helperText={errors.pno && errorMessages.pno}
              required
            />
            <TextField
              label="CGPA"
              variant="outlined"
              value={values.pno}
              onChange={(event) => onValueChange("pno", event)}
              error={errors.pno}
              helperText={errors.pno && errorMessages.pno}
              required
            />
          </form>
        </CardContent>
      </Card>
      <NavButtons {...props} validateInfo={validateInfo} />
    </div>
  );
};

export default Education;
